import React from "react";

const ImageLinkForm = () => {
    return (
		<div>
			<p className="f3">The Magic Brain will detect faces in your pictures. Give it a try!</p>
			<div className="outline flex justify-center pa3 ma3 mt0">
				<div className="outline flex justify-center">
					<input className="w-70" type='text' />
					<button className="w-30">Detect</button>
				</div>
			</div>
		</div>

    );
}

export default ImageLinkForm;
